import React, { Component } from "react";
import "./App.css";
import Navbar from "./Navbar";
import Search from "./Search";
import Carousel from "./Carousel";

class Main extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div className="Main-Area">
          <Search />
        </div>
      </React.Fragment>
    );
  }
}

export default Main;
